import React from 'react';
import './App.css';
import {Switch, Route} from 'react-router-dom';
import HomePage from './pages/homepage/homepage.component';
const HatsPge=()=>(
  <div>
    <h1>hatss paaage</h1>
  </div>
)
function App() {
  return (
    <div>
    <Switch>
      <Route exact path='/' component={HomePage}/>
      <Route exact path='/hats' component={HatsPge}/>

    </Switch>

    </div>

  );
}

export default App;
